package com.example.upsx.model;import lombok.Getter;import lombok.NoArgsConstructor;import lombok.Setter;import javax.persistence.*;@Entity@Table(name = "orders")@Setter@Getter@NoArgsConstructorpublic class Order {    @Id    @GeneratedValue(strategy = GenerationType.IDENTITY)    private long id;    private int truckId;    private long packageId;    private int whnum;    private int destX;    private int destY;    private String status;    public Order(int truckId, long packageId, int whnum, int destX, int destY) {        this.truckId = truckId;        this.packageId = packageId;        this.whnum = whnum;        this.destX = destX;        this.destY = destY;    }}